import React from "react";
import "./App.css";

const NyListItem = props => {
  return (
    <React.Fragment>
      <ul class="list-group">
        {!listArray.length === 0
          ? "No records to show.."
          : listArray.map((item, i) => {
              <li class="list-group-item list-group-item-primary">
                List item 1
              </li>;
            })}
      </ul>
    </React.Fragment>
  );
};

export default NyListItem;
